import { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";

export default function BookingPage() {
  const { roomId } = useParams();
  const [room, setRoom] = useState(null);
  const [checkInDate, setCheckInDate] = useState("");
  const [checkOutDate, setCheckOutDate] = useState("");
  const [totalPrice, setTotalPrice] = useState(0);
  const navigate = useNavigate();

  const user = JSON.parse(localStorage.getItem("user")); 

  useEffect(() => {
    if (!user) {
      alert("Please login to book a room.");
      navigate("/login");
    }
  }, [user, navigate]);

  useEffect(() => {
    axios.get(`http://localhost:8080/rooms/${roomId}`)
      .then(res => setRoom(res.data))
      .catch(err => console.log(err));
  }, [roomId]);

  const calculateTotalPrice = () => {
    if (!checkInDate || !checkOutDate || !room) return;

    const start = new Date(checkInDate);
    const end = new Date(checkOutDate);
    const diffTime = end - start;
    const diffDays = diffTime / (1000 * 60 * 60 * 24);

    if (diffDays <= 0) {
      alert("Check-out date must be after check-in date.");
      return;
    }

    setTotalPrice(diffDays * room.price);
  };

  const handleBooking = () => {
    if (!checkInDate || !checkOutDate) {
      alert("Please select check-in and check-out dates.");
      return;
    }

    if (totalPrice <= 0) {
      alert("Invalid dates. Please check your selection.");
      return;
    }

    const bookingData = {
      userId: user.id,
      roomId,
      checkInDate,
      checkOutDate,
      totalPrice,
      status: "booked"
    };

    axios.post("http://localhost:8080/bookings", bookingData)
      .then(() => {
        alert("Room booked successfully!");
        navigate("/");
      })
      .catch(err => console.log(err));
  };

  return (
    <div style={{ maxWidth: "700px", margin: "30px auto", padding: "20px", border: "1px solid #ddd", borderRadius: "8px", boxShadow: "0 4px 8px rgba(0,0,0,0.1)", fontFamily: "-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif" }}>
      
      {room ? (
        <>
          <h2 style={{ marginBottom: "20px" }}>Booking: {room.roomType}</h2>
          <img src={room.imageUrl} alt={room.roomType} style={{ width: "100%", height: "250px", objectFit: "cover", marginBottom: "20px" }} />
          <p><strong>Price per Night:</strong> ₹{room.price}</p>

          <div style={{ marginTop: "20px" }}>
            <label>Check-in Date:</label><br />
            <input type="date" value={checkInDate} onChange={(e) => setCheckInDate(e.target.value)} style={{ padding: "8px", width: "100%", marginBottom: "10px" }} />

            <label>Check-out Date:</label><br />
            <input type="date" value={checkOutDate} onChange={(e) => setCheckOutDate(e.target.value)} style={{ padding: "8px", width: "100%", marginBottom: "15px" }} />

            <button onClick={calculateTotalPrice} style={{ width: "100%", padding: "10px", backgroundColor: "#0071c2", color: "white", border: "none", marginBottom: "15px", cursor: "pointer" }}>
              Calculate Total Price
            </button>

            {totalPrice > 0 && (
              <p><strong>Total Price:</strong> ₹{totalPrice}</p>
            )}

            <button onClick={handleBooking} style={{ width: "100%", padding: "10px", backgroundColor: "green", color: "white", border: "none", cursor: "pointer", marginTop: "15px" }}>
              Confirm Booking
            </button>
          </div>
        </>
      ) : (
        <p>Loading room details...</p>
      )}
    </div>
  );
}
